  \"2016-04-19T02:28:15.797097\",\n\t\"name\": \"landfills-buffered\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset is used by the City of Austin
  to locate the buffers around landfills. Not all landfills will necessarily be included.
  This dataset was created in the year 2007. There are restrictions to development
  for properties that are within the landfills buffers. This layer represents the
  buffered geography around the known landfills in and around the City of Austin,
  Texas. Due to the uncertainty of the boundaries of the landfills; the buffers are
  used to regulate development in close proximity to the landfills. Areas of known
  landfill boundaries utilize the 200' buffer. Areas where general knowledge of the
  landfill location is known utilize a 1500' buffer.\",\n\t\"license_title\": \"License
